
<!DOCTYPE html>
<html>
<head>
    <title>Inkscape Output</title>
</head>
<body>
    <canvas id='canvas' width='612' height='792'></canvas>
    <script>
    var ctx = document.getElementById("canvas").getContext("2d");
    	
// #Layer_1
	
// #path4
	ctx.beginPath();
	ctx.fillStyle = 'rgb(255, 255, 255)';
	ctx.strokeStyle = 'rgb(0, 0, 0)';
	ctx.miterLimit = 10;
	ctx.moveTo(64.400000, 14.300000);
	ctx.lineTo(390.200000, 14.300000);
	ctx.bezierCurveTo(390.200000, 14.300000, 468.100000, 148.400000, 390.200000, 282.600000);
	ctx.bezierCurveTo(220.600000, 148.500000, 64.400000, 282.600000, 64.400000, 282.600000);
	ctx.bezierCurveTo(64.400000, 282.600000, -37.800000, 148.400000, 64.400000, 14.300000);
	ctx.closePath();
	ctx.fill();
	ctx.stroke();
	
// #Layer_2
	
// #Layer_3

	ctx.bezierCurveTo(205.300000, 351.100000, 164.800000, 373.900000, 120.200000, 351.100000);
	ctx.closePath();

// #path10

	ctx.bezierCurveTo(212.300000, 369.400000, 169.200000, 399.200000, 114.300000, 369.400000);

    </script>
</body>
</html>
